import { Route, Routes } from 'react-router-dom';
import './App.css';
import Paperbase from './components/dashboard/Paperbase';

function App() {
  return (
    <div className="App">
       <Routes>
             <Route exact path="/" element={<Paperbase/>} /> 
        </Routes>
    </div>
  );
}

export default App;
